t1pWwoEVTE00-2\&quot; value=\&quot;Los monos caí cambian sus patrones de movimiento y el uso del espacio en paisajes forestales en relación a los cambios en la rentabilidad y disponibilidad de recursos, ya sea por variación natural (incremento de rentabilidad del floema de pinos en primavera)\&quot; style=\&quot;text;whiteSpace=wrap;fontFamily=Ruda;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DRuda;fontColor=#FFFFFF;fontSize=31;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;-740\&quot; y=\&quot;-1460\&quot; width=\&quot;1490\&quot; height=\&quot;50\&quot; as=\&quot;geometry\&quot;/&gt;&lt;/mxCell&gt;&lt;mxCell id=\&quot;1aDNmf4ct1pWwoEVTE00-3\&quot; value=\&quot;Sub-hipótesis.&amp;#10;Los paisajes de plantaciones forestales tienen menor productividad y disponibilidad media de recursos (frutos e invertebrados) y mayor variación espacial que el bosque nativo continuo por lo que los monos caí en los paisajes de plantaciones forestales tendrán patrones de movimiento y de uso del espacio distintos a los que tienen en bosques continuos y poco intervenidos (e.g., Parque Nacional Iguazú). &amp;#10;&amp;#10;Predicción 1&amp;#10;Los grupos de monos tendrán mayores recorridos diarios, mayor velocidad en sus desplazamientos y áreas de acción más grandes en los paisajes de plantaciones que en el bosque nativo continuos.&amp;#10;&amp;#10;Predicción 2&amp;#10;En los paisajes productivos, las áreas núcleo de las áreas de acción de los grupos de monos caí van a estar concentradas en los remanentes de bosque nativo, mientras que las plantaciones forestales serán usadas con menor frecuencia y en forma estacional (cuando la rentabilidad del floema como alimento es máxima).\&quot; style=\&quot;text;whiteSpace=wrap;fontFamily=Ruda;fontSource=https%3A%2F%2Ffonts.googleapis.com%2Fcss%3Ffamily%3DRuda;fontColor=#FCFCFC;fontSize=22;\&quot; parent=\&quot;1\&quot; vertex=\&quot;1\&quot;&gt;&lt;mxGeometry x=\&quot;-738\&quot; y=\&quot;-1310\&quo
